import React from "react";
import "../styles/profile.css"; // Styles for profile page
import backgroundImage from "../components/background_profile.webp"; 

const Profile = () => {
  return (
      <div
        className="page profile"
        style={{ backgroundImage: `url(${backgroundImage})` }} // ✅ Apply inline
      >
        <h1>Profile Page</h1>
      </div>
    );
};

export default Profile;
